import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";

const Clubs = () => {
  const [clubs, setClubs] = useState([]);
  const [filters, setFilters] = useState({
    name: "",
    league: "",
    nation: "",
  });

  const navigate = useNavigate();

  useEffect(() => {
    // Sahte kulüp verilerini oluştur
    const mockData = Array.from({ length: 50 }, (_, i) => ({
      id: i + 1,
      name: `Club ${i + 1}`,
      league: `League ${i % 5 + 1}`,
      nation: `Country ${i % 10 + 1}`,
      manager: `Manager ${i + 1}`,
      city: `City ${i % 10 + 1}`,
      established: 1900 + (i % 120),
    }));
    setClubs(mockData);
  }, []);

  const handleFilterChange = (e) => {
    setFilters({ ...filters, [e.target.name]: e.target.value });
  };

  const filteredClubs = clubs.filter((club) =>
    Object.keys(filters).every((key) =>
      filters[key] === "" || club[key]?.toLowerCase().includes(filters[key].toLowerCase())
    )
  );

  return (
    <div style={{ display: "flex", padding: "20px" }}>
      {/* Filtreleme Alanı */}
      <aside style={{ width: "25%", padding: "10px", borderRight: "1px solid #ddd" }}>
        <h3>Filters</h3>
        <div style={{ marginBottom: "10px" }}>
          <label>Name</label>
          <input
            type="text"
            name="name"
            value={filters.name}
            onChange={handleFilterChange}
            style={{ width: "100%", padding: "5px", marginTop: "5px" }}
          />
        </div>
        <div style={{ marginBottom: "10px" }}>
          <label>League</label>
          <input
            type="text"
            name="league"
            value={filters.league}
            onChange={handleFilterChange}
            style={{ width: "100%", padding: "5px", marginTop: "5px" }}
          />
        </div>
        <div style={{ marginBottom: "10px" }}>
          <label>Nation</label>
          <input
            type="text"
            name="nation"
            value={filters.nation}
            onChange={handleFilterChange}
            style={{ width: "100%", padding: "5px", marginTop: "5px" }}
          />
        </div>
      </aside>

      {/* Kulüp Listesi */}
      <div style={{ width: "75%", padding: "10px" }}>
        <h3>Clubs</h3>
        <table style={{ width: "100%", borderCollapse: "collapse", textAlign: "left" }}>
          <thead>
            <tr>
              <th style={{ borderBottom: "2px solid #ddd", padding: "10px" }}>Name</th>
              <th style={{ borderBottom: "2px solid #ddd", padding: "10px" }}>League</th>
              <th style={{ borderBottom: "2px solid #ddd", padding: "10px" }}>Nation</th>
              <th style={{ borderBottom: "2px solid #ddd", padding: "10px" }}>Manager</th>
            </tr>
          </thead>
          <tbody>
            {filteredClubs.map((club) => (
              <tr
                key={club.id}
                style={{ cursor: "pointer", borderBottom: "1px solid #ddd" }}
                onClick={() => navigate(`/clubs/${club.id}`)}
              >
                <td style={{ padding: "10px" }}>{club.name}</td>
                <td style={{ padding: "10px" }}>{club.league}</td>
                <td style={{ padding: "10px" }}>{club.nation}</td>
                <td style={{ padding: "10px" }}>{club.manager}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default Clubs;
